// Table with Expand Collapse
$(document).ready(function () {
	$(".child-table-expand").click(function(){
		$(".direct-child-table").slideToggle(300);
		$(this).toggleClass( "child-table-collapse" );
	});
});
/*slider carousel js*/
 $('#slider-carousel').owlCarousel({
	autoplay:true,
	loop:true,
	margin:0,
	items:1,
	nav:true,
	responsive:{
		0:{
			nav:false,
			dots:true
		},
		600:{
		nav:true,
		dots:true
		},
		1000:{
			nav:true,
			dots:true
		}
	}
});

/*basic propeller card js*/
$('#card-carousel').owlCarousel({
	loop:true,
	items:3,
	responsive:{
	0:{
		items:1,
		nav:false,
		dots:true
	},
	600:{
		items:3,
		nav:false,
		dots:true
	},
	1000:{
		items:3,
		nav:true,
		dots:true
	}
}
});   

/*responsive js*/
$('#responsive-carousel').owlCarousel({
loop:true,
responsiveClass:true,
responsive:{
	0:{
		items:1,
		nav:false
	},
	600:{
		items:3,
		nav:false,
		dots:true
	},
	1000:{
		items:3,
		nav:true,
		dots:true
	}
}
});   

/*center with loop js*/
$('#center-loop-carousel').owlCarousel({
center:true,
items:2,
loop:true,
dots:false,
responsive:{
	0:{
		items:1
	},
	600:{
		items:3
	},
	1000:{
		items:4
	},
}
});

/*center without loop js*/
$('#center-nonloop-carousel').owlCarousel({
center:true,
items:2,
loop:false,
dots:false,
responsive:{
	0:{
		items:1
	},
	600:{
		items:3
	},
	1000:{
		items:4
	},
}
});  

/*merge js*/
$('#merge-carousel').owlCarousel({
	items:5,
    loop:true,
    margin:10,
    merge:true,
    responsive:{
        678:{
            mergeFit:true
        },
        1000:{
            mergeFit:false
        }
    }
});

/* url hashing navigation js*/
$('#urlhash-carousel').owlCarousel({
	dots:false,
	loop:true,
	items:4,
	center:true,
	URLhashListener:true,
	autoplayHoverPause:true,
	startPosition: 'URLHash',
	responsive:{
	0:{
		items:1
	},
	600:{
		items:3
	},
	1000:{
		items:4
	}
}
}); 
	
/* Stage padding js*/
$('#padding-carousel').owlCarousel({
	loop:true,
	dots:false,
	responsive:{
	0:{
		items:1,
		stagePadding:30,
	},
	600:{
		items:2,
		stagePadding:70,
	},
	1000:{
		items:4,
		stagePadding:70,
	}
}
});

/* autoplay js*/
var owl = $('#autoplay-carousel');
owl.owlCarousel({
	items:3,
	dots:false,
	loop:true,
	autoplay:true,
	autoplayTimeout:2000,
	autoplayHoverPause:true,
	responsive:{
		0:{
			items:1
		},
		600:{
			items:3
		},
		1000:{
			items:4
		}
	}
});
$('.play').on('click',function(){
	owl.trigger('play.owl.autoplay',[1000])
})
$('.stop').on('click',function(){
	owl.trigger('stop.owl.autoplay')
});

/* animate js*/
$('#animate-carousel').owlCarousel({
animateOut: 'slideOutDown',
animateIn: 'flipInX',
items:1,
smartSpeed:450
});

