function initThemeChooser(settings) {
  var isInitialized = false;
  var $currentStylesheet = $();
  var $loading = $('#loading');
  var $systemSelect = $('#theme-system-selector select')
    .on('change', function() {
      setThemeSystem(this.value);
    });

  setThemeSystem($systemSelect.val());


  function setThemeSystem(themeSystem) {
    var $allSelectWraps = $('.selector[data-theme-system]').hide();
    var $selectWrap = $allSelectWraps.filter('[data-theme-system="' + themeSystem +'"]').show();
    var $select = $selectWrap.find('select')
      .off('change') // avoid duplicate handlers :(
      .on('change', function() {
        setTheme(themeSystem, this.value);
      });

    setTheme(themeSystem, $select.val());
  }


  function setTheme(themeSystem, themeName) {
    var stylesheetUrl = generateStylesheetUrl(themeSystem, themeName);
    var $stylesheet;

    function done() {
      if (!isInitialized) {
        isInitialized = true;
        settings.init(themeSystem);
      }
      else {
        settings.change(themeSystem);
      }

      showCredits(themeSystem, themeName);
    }

    if (stylesheetUrl) {
      $stylesheet = $('<link rel="stylesheet" type="text/css" href="' + stylesheetUrl + '"/>').appendTo('head');
      $loading.show();

      whenStylesheetLoaded($stylesheet[0], function() {
        $currentStylesheet.remove();
        $currentStylesheet = $stylesheet;
        $loading.hide();
        done();
      });
    } else {
      $currentStylesheet.remove();
      $currentStylesheet = $();
      done();
    }
  }


  function generateStylesheetUrl(themeSystem, themeName) {
    if (themeSystem === 'jquery-ui') {
      return 'https://code.jquery.com/ui/1.12.1/themes/' + themeName + '/jquery-ui.css';
    }
    else if (themeSystem === 'bootstrap3') {
      if (themeName) {
        return 'https://bootswatch.com/3/' + themeName + '/bootstrap.min.css';
      }
      else { // the default bootstrap theme
        return 'https://maxcdn.bootstrapcdn.com/bootstrap/3.3.7/css/bootstrap.min.css';
      }
    }
    else if (themeSystem === 'bootstrap4') {
      if (themeName) {
        return 'https://bootswatch.com/4/' + themeName + '/bootstrap.min.css';
      }
      else { // the default bootstrap4 theme
        return 'https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css';
      }
    }
  }


  function showCredits(themeSystem, themeName) {
    var creditId;

    if (themeSystem === 'jquery-ui') {
      creditId = 'jquery-ui';
    }
    else if (themeSystem === 'bootstrap3') {
      if (themeName) {
        creditId = 'bootstrap-custom';
      }
      else {
        creditId = 'bootstrap-standard';
      }
    }

    $('.credits').hide()
      .filter('[data-credit-id="' + creditId + '"]').show();
  }


  function whenStylesheetLoaded(linkNode, callback) {
    var isReady = false;

    function ready() {
      if (!isReady) { // avoid double-call
        isReady = true;
        callback();
      }
    }

    linkNode.onload = ready; // does not work cross-browser
    setTimeout(ready, 2000); // max wait. also handles browsers that don't support onload
  }
}

// table fixed header 
$.fn.fixedHeader = function (options) {
	var config = { 
		topOffset: 50
	};
	if (options) {
		$.extend(config, options);
	}
	return this.each(function () {
		
		var $this = $(this);
		var $head = $this.find('thead.header');
		var isFixed = 0;
		var headTop = $head.length && $head.offset().top - config.topOffset;
		
		// Table horizontal scroll effect 
		function processScroll() {
			if (!$this.is(':visible')) {
			  return;
			}
			var i;
			var scrollTop = $this.scrollTop();
			var t = $head.length && $head.offset().top - config.topOffset;
			
			if (!isFixed && headTop !== t) {
			  headTop = t;
			}
			if (scrollTop >= headTop && !isFixed) {
			  isFixed = 1;
			} else if (scrollTop <= headTop && isFixed) {
			  isFixed = 0;
			}
			
			isFixed || !isFixed ? $('thead.header-copy', $this).offset({
			  left: $head.offset().left
			}).removeClass('') : $('thead.header-copy', $this).addClass('');
		}

		// Window on scroll event for horizontal scroll
		$this.on('scroll',function(){
			processScroll();
		});
		
		// hack sad times - holdover until rewrite for 2.1
		$head.on('click', function () {
			if (!isFixed) {
				setTimeout(function () {
					$this.scrollTop($this.scrollTop() - 47);
				}, 10);
			}
		});
			
		// append a duplicate header 
		if(!$this.find('.header-copy.header-fixed').length){
			$head.clone().removeClass('header').addClass('header-copy header-fixed').appendTo($this.children("table"));
		}
			  
		// get header width and th width
		$this.find('thead.header > tr > th').each(function(i){
			var headWidth = $(this).innerWidth();
			$this.find('thead.header-copy th:eq(' + i + ')').css("min-width",headWidth+"px");
		});
		 
		// CSS for sticky Header 
		var currentTab = $this.attr("class");
		processScroll();

		window.onscroll = function() {myFunction()};
		function myFunction() {
		  var currentScroll = $(this).scrollTop();
			var headerHeight = $(".navbar").outerHeight() - 40;
			var tableHeaderTop = $this.offset().top;
			var targetArea = tableHeaderTop - headerHeight ;
			var tableHeight = $this.height();
			var tableRowHeight = $this.find("tr:last-child").outerHeight();
			var ScrollHeight = (tableHeight - tableRowHeight);
			if (currentScroll > targetArea) {
				var newTopPosition = currentScroll - targetArea;
				$this.find(".header-copy").css("top",newTopPosition+"px");
				$this.find(".header-copy").css("box-shadow","0px 5px 32px rgba(0,0,0,.08)");
			} else {
				$this.find(".header-copy").css("top","0");
				$this.find(".header-copy").css("box-shadow","none");
			}
		}

	});
};
		
$(window).on("load resize",function(){
 	$('.scrollable-table').fixedHeader();
});

