$(document).ready(function() {
		
	// Navbar active add remove on click
	$(window).on("scroll load", onScroll);
		$('.page-menu-sidebar a').on('click', function(e) {
			e.preventDefault();
			$(document).off("scroll");
			var target = this.hash,
			$target = $(target);
			$('html, body').stop().animate({
				'scrollTop': $target.offset().top - 100
			}, 1000, 'swing', function() {
			$(document).on("scroll", onScroll);
		});			
	});

	// Navbar active add remove on scroll
	function onScroll(e) {
		var scrollPos = $(document).scrollTop() - 40;
		$('.page-menu-sidebar a').each(function() {
			var currLink = $(this);
			var refElement = $(currLink.attr("href"));
			if (refElement !== undefined){
				if (refElement.position().top <= scrollPos && refElement.position().top + refElement.height() > scrollPos) {
					$('.page-menu-sidebar a').removeClass("nav-active");
					currLink.addClass("nav-active");
					var spanTop = $('.nav-active').offset().top - $('.nav').offset().top;
					var navheight = currLink.outerHeight();
					$('.nav .tab-anim').css({"top":spanTop - 3, "height": navheight });
				} else {
				//	currLink.removeClass("nav-active");
				}
			}
		});
	}
	
	$( '.page-menu-sidebar .list-group a[href*=\\#]:not([href=\\#])' ).click( function () {
		if ( location.pathname.replace( /^\//, '' ) == this.pathname.replace( /^\//, '' ) && location.hostname == this.hostname ) {
			var target = $( this.hash );
			target = target.length ? target : $( '[name=' + this.hash.slice( 1 ) + ']' );
			if ( target.length ) {
				$( 'html,body' ).animate( {
					scrollTop: target.offset().top - 100
				}, 1000 );
				return false;
			}
		}
	} );
	
});

